records.addlTxt:
Defendant Lisa M Alexander in court, in custody, with attorney Katie B. Kegel.  Stephen Joseph Centinario appeared for the State of Wisconsin.  Defendant enters a guilty plea to Count 1.  Court finds defendant guilty.
Parties make sentencing arguments.  The Defendant was sentenced to the following:

IMPOSED AND STAYED SENTENCE OF:   

12 MONTHS JAIL STRAIGHT

TERM OF PROBATION:  3 YEAR(S);

CONDITIONS OF PROBATION:  
*AODA Assessment and follow through with any treatment recommended;
*Absolute Sobriety; Random U.A.'s ; 
*No Use or Possession of alcohol, controlled substances or drug paraphernalia.
*No Use or Possession of prescription drugs without a valid prescription;
*Any valid prescription drugs must be taken only in the manner in which they are prescribed.
*Inform Agent of all prescriptions
*All prescriptions must be filled at the same pharmacy;
*Follow through with any treatment and/or counseling recommended by Agent;
*Maintain employment and/or combination of schooling 
*No contact with:  Christian Rivera
*No association with known drug users or dealers and no contact at any place where illegal drugs are purchased, used, stored, packaged, or distributed.
*Attend Criminal Thinking course

COURT COSTS:  $268.00 (apply cash bail - refund balance to poster);

DNA SURCHARGE:  $250.00 (apply cash bail - refund balance to poster);
Defendant to provide DNA sample, if not yet provided, immediately if in custody otherwise within (3) business days at the Waukesha County Sheriff Department.

CONDITION TIME: 6 months.  First 4 months Huber with release for work search (Credit - 47 days).  Last 2 months STAYED for Day Report Center.  Agent to determine with or without non working hours.  

Felony warnings, voting rights and firearms warnings given. 

Defense requests expunction.  State objects.  Defense makes argument.  Expunction is conditionally granted upon verification of completion of sentence and no new criminal law violations.  However, if any portion of the two months stayed condition time is utilized by the agent, Court then denies expunction.
